import React, { useState } from "react";

const CardItem = (props) => {
  CardItem.propTypes = {
    products: PropTypes.array,
  };
  CardItem.defaultProps = {
    products: [],
  };
  const { produts } = props;
  return (
    <div>
      {produts.map}
    </div>
  );
};

export default CardItem;
